import React, { Component } from "react";

import './Profile.css';

export default class Profile extends Component {
    render() {
        return (
            <div className="profile">
                <div className="container">
                    <div className="row">
                        <div className="col-12">
                            <div className="profile-inner">
                                <button>LOGIN</button>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}
